				</p>
				<div className='center'>
					<div className='center pa3 shadow-5 br3'>
						<input className= ' form f4 pa2 w-70 center' type='text'/>
						<button className='w-30 grow f4 link bg-purple pv2 ph3 '>Detect</button>
					</div>
				</div>
			</div>


		)
};

